import React, { useState, useEffect } from 'react';
import axios from "axios";

function App() {

  const [data, setData] = useState([{}])

  useEffect(() => {
    axios.get("/members").then(
      data => {
        setData(data.members)
        console.log(data)
      }
    )
  }, [])
  return (
    <div>
      {(typeof data.members === 'undefined') ? (
        <p>Loading...</p>
      ) : (
        data.members.map((member, i) => (
          <p key={i}>{member}</p>
        )) 
      )}

    </div>
  )
}

export default App
